import React from 'react';

export default function LunchMenu() {
	return (
		<div>
			<h3>FOODdd</h3>
			<p>scoped!</p>
			<style jsx>{`
				p {
					color: blue;
				}
				div {
					background: red;
				}
				@media (max-width: 600px) {
					div {
						background: blue;
					}
				}
			`}</style>
			<style global jsx>{`
				body {
					background: black;
				}
			`}</style>
		</div>
	);
}
